import { TextInput } from "./component/TextInput";
import { Eye, EyeOff, DollarSign } from "lucide-react";


function App() {
  return(
    <div>
      <h1>Components</h1><br></br>
      <TextInput picture={<DollarSign />} label="Enter you amount : " type={Number}/>
      <br></br>
      <TextInput label="Enter your password : "/>
      <br></br>
      <TextInput label="This is a read only file ...." readOnly={true}/>
      <br></br>
      <TextInput label="This file is disabled ...." disabled={true}/>
    </div>

  )
}

export default App
